    private static List<HashMap<String, Object>> handleJSONArray(JSONArray jsonArray){
        List list = new ArrayList();
        for (Object object : jsonArray) {
            JSONObject jsonObject = (JSONObject) object;
            HashMap map = new HashMap<String, Object>();
            for (Map.Entry entry : jsonObject.entrySet()) {
                if(entry.getValue() instanceof  JSONArray){
                    map.put((String)entry.getKey(), handleJSONArray((JSONArray)entry.getValue()));
                }else{
                    map.put((String)entry.getKey(), entry.getValue());
                }
            }
            list.add(map);
        }
        return list;
    }

    public static List<List> listObjectToMap(List<Map> mapList) {
        List<List> list = new ArrayList();
        for (Map mapField : mapList) {
            List listFields = new ArrayList();
            Collection<Object> collection = mapField.values();
            for (Object field : collection) {
                listFields.add(field);
            }
            list.add(listFields);
        }
        return list;
    }


    public static Map<String, Object> objectToMap(Object obj) throws IllegalAccessException {
        Map<String, Object> map = new HashMap<String, Object>();
        Class<?> clazz = obj.getClass();
        System.out.println(clazz);
        for (Field field : clazz.getDeclaredFields()) {
            field.setAccessible(true);
            String fieldName = field.getName();
            Object value = field.get(obj);
            map.put(fieldName, value);
        }
        return map;
    }

    private List<List> getListByJsonStr(String jsonStr) {
        List<List> list = new ArrayList();
        List<HashMap> linkedHashMapList = new ArrayList<>();
        List<Map> mapList = JSON.parseArray(jsonStr, Map.class);
        for (Map mapField : mapList) {
            List listFields = new ArrayList();
            Collection<Object> collection = mapField.values();
            for (Object field : collection) {
                listFields.add(field);
            }
            list.add(listFields);
        }
        return list;
    }

